import React from 'react';

function Macdonalds(props) {
    const myStyle = {
        justifyContent: 'center',
        alignItems: 'center',
        width: '300px',
        height: '300px',
        fontSize: '23px',
        marginLeft: '300px'
    }
    return (
        <div className="macdonalds" style={myStyle}>
            <img src="https://hvylya.net/images/2022/07/02/HzppTVQB4ypilC2IXn0NbrzHmakLKAF7qY579ddD.jpeg" alt=""/>
            <p style={myStyle}>
                Welcome to macdonalds its place where you
                can eat many burgers and drinking coca cola
            </p>
        </div>
    );
}

export default Macdonalds;
